package com.leonardo.gomes.pojo;

public class LegalitiesPojo {
	String format;
	String legality;
	public LegalitiesPojo() {
		super();
		// TODO Auto-generated constructor stub
	}
	public LegalitiesPojo(String format, String legality) {
		super();
		this.format = format;
		this.legality = legality;
	}
	public String getFormat() {
		return format;
	}
	public void setFormat(String format) {
		this.format = format;
	}
	public String getLegality() {
		return legality;
	}
	public void setLegality(String legality) {
		this.legality = legality;
	}
	
	
}
